import './preTimeTable.css';
import React from 'react';
import { BrowserRouter as Router,Link } from 'react-router-dom';//BrowserRouter
import { Routes ,Route } from 'react-router-dom';
import {useNavigate} from 'react-router-dom';
import {useState} from "react";
import { useCookies } from 'react-cookie';
import { onLogin } from "./cookie.js";
import { setAuthToken } from "./utils";

const PreTimeTable=()=> {

    let navigate = useNavigate();
    const [cookies, setCookie] = useCookies(['token']);
    const [error, setError] = useState(false);

    function PreTimeTable() {
        const [searchTerm, setSearchTerm] = useState('');
        const [searchResults, setSearchResults] = useState([]);
        const [data, setData] = useState('');
        useEffect(() => {
            if (searchTerm) {          
              fetch(`/search?query=${searchTerm}`)
                .then((response) => response.json())
                .then((data) => {
                    setSearchResults(data);
                    console.log(data);
                })
                .catch((error) => {
                  console.error('搜索错误:', error);
                });
            } else {
              // 清除搜索结果
              setSearchResults([]);
            }
          }, [searchTerm]);

      return (
        
        <div className="PreTimeTable">    
            <input type="text" placeholder="输入关键字" value={searchTerm} onChange={(e) => setSearchTerm(e.target.value)}/>

        </div>
      );
    }

    return (

           
                <Routes>
                    <Route path="/" element={<PreTimeTable />} />
                </Routes>
             
    );
}

export default PreTimeTable;
